import React from "react";
import "./App.css";
import SortingVisualizer from "./Components/SortingVisualizer/SortingVisualizer";
import { PsudoAlgo } from "./Components/PsudoAlgorithms/PsudoAlgo";
import TopNav from "./Components/TopNav/TopNav";
const App = () => {
  return (
    <>
      <div className="topContainer">
        <ul className="navLinks">
          <li>
            <select>
              <option className="bubbleSort">Bubble Sort</option>
              <option className="quickSort">Quick Sort</option>
              <option className="shellSort">ShellSort</option>
              <option className="heapSort">Heap Sort</option>
              <option className="mergeSort">Merge Sort</option>
              <option className="emptySort">Empty Sort</option>
              <option className="selectionSort">Selection Sort</option>
              <option className="insertionSort">Insertion Sort</option>
            </select>
          </li>
          <li>
            <button>Generate New Array.</button>
          </li>
          <li>
            <button>Sort</button>
          </li>
        </ul>
      </div>
      <div className="bottomContainer">
        <div className="psudoCodeContainer">
          <PsudoAlgo />
        </div>
        <SortingVisualizer />
      </div>
    </>
  );
};

export default App;
